loc09_text_beschr:
Grube in ca. 30 cm Tiefe, Dm. 1,5 m bis 1,6 m; 3 schichten erkennbar:
1. Schwach lehmige, dunkelgraue Verfüllschicht mit Asche, Hüttenlehm & finer Holzkohle;
2. Rotbraunes, schwach lemiges Band, steril;
3. Löß, leicht rotbraun gefleckt mit geringen Holzkohle- und Hüttenlehmresten.

Grube von ca. 1,50 m Breite in ca. 0,60 m unter dem Humus, eventuell schwalbenschwanzförmig. Dunkelbraune Verfüllung, durchsetzt mit Tierknochenresten und Keramikfragmenten.
Funde wurden nicht den einzelnen Schichten zugeordnet, letztere aber aufgrund einer Profilskizze bekannt:
Schicht 1: Aschgraue, locker-sandige Schicht mit Holzkohle;
Schicht 2: Leicht angeziegelter Löß, locker, sandig;
Schicht 3: Hellbrauner Löß, leicht lehmig, zum anstehenden reinen Löß hin an den Grenzen kleine Steinchen;
Schicht 4: Anstehender Löß;
Schicht 5: Wie Schicht 3, aber dunkler und lehmig.

